    LANGUAGE plpgsql
    AS $$
DECLARE
    result json;
BEGIN
    IF period = 'day' THEN
        SELECT json_agg(t) INTO result FROM (
            SELECT to_char(h, 'HH24') || ':00' AS date_trunc,
                   COALESCE(stats.total_requests, 0) AS total_requests,
