, CallbackQueryHandler\n\nlogging.basicConfig(level=logging.INFO)\nlogger = logging.getLogger(__name__)\n\n# \nBOT_TOKEN = "_BOT_TOKEN"\nSPREADSHEET_ID = "14a6G8p_Q3Gkf3yIRZkUVE62RLXzoxoZ2Kk6f169Qzpg"  #  URL\nDATA_SHEET_NAME = ""\n#  \nASK_FIO, ASK_PHONE = range(2)\n\n#   Google Sheets  service account\ndef get_gs_client():\n    scopes = ['https://www.googleapis.com/auth/spreadsheets', 'https://www.googleapis.com/auth/drive']\n    creds = ServiceAccountCredentials.from_json_keyfile_name('service_account.json', scopes)\n    gc = gspread.authorize(creds)\n    return gc\n\ndef write_user_to_sheet(chat_id, fio, phone):\n    gc = get_gs_client()\n    sh = gc.open_by_key(SPREADSHEET_ID)\n    ws = sh.worksheet(DATA_SHEET_NAME)\n    # append_row: [id, , ]\n    ws.append_row([chat_id, fio, phone])\n\n#   \nasync def start(update: Update, context: ContextTypes.DEFAULT_TYPE):\n    user = update.effective_user\n    await update.message.reply_text("! ,  :")\n    return ASK_FIO\n\nasync def ask_fio(update: Update, context: ContextTypes.DEFAULT_TYPE):\n    context.user_data['fio'] = update.message.text.strip()\n    #       \n    kb = [[KeyboardButton(" ", request_contact=True)]]\n    await update.message.reply_text(", ,   (  ):", reply_markup=ReplyKeyboardMarkup(kb, one_time_keyboard=True, resize_keyboard=True))\n    return ASK_PHONE\n\nasync def ask_phone(update: Update, context: ContextTypes.DEFAULT_TYPE):\n    #      \n    if update.message.contact:\n        phone = update.message.contact.phone_number\n    else:\n        phone = update.message.text.strip()\n    fio = context.user_data.get('fio')\n    chat_id = update.effective_user.id\n    #   Google Sheet\n    try:\n        write_user_to_sheet(chat_id, fio, phone)\n        await update.message.reply_text(" . !")\n    except Exception as e:\n        logger.exception("   ")\n        await update.message.reply_text("   .  .")\n    return ConversationHandler.END\n\nasync def cancel(update: Update, context: ContextTypes.DEFAULT_TYPE):\n    await update.message.reply_text(".")\n    return ConversationHandler.END\n\n#  callback_query   (approve:ROW  reject:ROW)\nasync def callback_query_handler(update: Update, context: ContextTypes.DEFAULT_TYPE):\n    query = update.callback_query\n    await query.answer()\n    data = query.data  # example: "approve:5"\n    if not data:\n        return\n    parts = data.split(":")\n    action = parts[0]\n    row = int(parts[1])\n    gc = get_gs_client()\n    sh = gc.open_by_key(SPREADSHEET_ID)\n    ws_zayavki = sh.worksheet("")\n    #   \n    row_values = ws_zayavki.row_values(row)\n    #  :   \n    # ,   ID     ""   "id"     ""?\n    #    id     "".   ""         id   "".\n    #   :    ""      ,   chat_id.\n    phone_in_row = None\n    link_in_row = None\n    #    ""  " "  \n    headers = ws_zayavki.row_values(1)\n    try:\n        phone_idx = headers.index("") + 1\n    except ValueError:\n        phone_idx = None\n    try:\n        link_idx = headers.index(" ") + 1\n    except ValueError:\n        link_idx = None\n\n    if phone_idx:\n        phone_in_row = ws_zayavki.cell(row, phone_idx).value\n    if link_idx:\n        link_in_row = ws_zayavki.cell(row, link_idx).value\n\n    if action == "approve":\n        #  chat_id   ""    \n        ws_data = sh.worksheet(DATA_SHEET_NAME)\n        all_data = ws_data.get_all_records()\n        target_chat_id = None\n        for r in all_data:\n            if phone_in_row and ('' in r and r[''] and r[''].strip() == phone_in_row.strip()):\n                target_chat_id = r.get('id')\n                break\n        if not target_chat_id:\n            await query.edit_message_text(f"  user (chat_id)   {row}.  .")\n            return\n        #   \n        try:\n            await context.bot.send_message(chat_id=int(target_chat_id), text=f"  : {link_in_row}")\n            await query.edit_message_text(f"   (row {row}).")\n        except Exception as e:\n            logger.exception("   ")\n            await query.edit_message_text(f"   : {e}")\n    else:\n        await query.edit_message_text(f"  (row {row}).")\n\ndef main():\n    app = ApplicationBuilder().token(BOT_TOKEN).build()\n\n    conv_handler = ConversationHandler(\n        entry_points=[CommandHandler('start', start)],\n        states={\n            ASK_FIO: [MessageHandler(filters.TEXT & ~filters.COMMAND, ask_fio)],\n            ASK_PHONE: [MessageHandler((filters.CONTACT | filters.TEXT) & ~filters.COMMAND, ask_phone)],\n        },\n        fallbacks=[CommandHandler('cancel', cancel)],\n    )\n\n    app.add_handler(conv_handler)\n    app.add_handler(CallbackQueryHandler(callback_query_handler))\n\n    app.run_polling()\n\nif __name__ == '__main__':\n    main()\n```\n\n:\n-   ""   chat_id (user id), , .\n-   callback_query        "".      (  / ,    chat_id   "",    ).\n\n 4   Google Apps Script        \n-  Google Sheets: Extensions  Apps Script.  ,    .\n-  Project properties (File  Project properties  Script properties) :\n  - BOT_TOKEN =   (,     Properties)\n  - ADMIN_CHAT_ID = chat id  (     )\n\n GAS (bound script):\n```\nfunction onEditNotify(e) {\n  try {\n    var sheet = e.range.getSheet();\n    if (sheet.getName() != "") return;\n\n    var headerRow = 1;\n    var headers = sheet.getRange(headerRow, 1, 1, sheet.getLastColumn()).getValues()[0];\n    var linkColIndex = headers.indexOf(" ") + 1;\n    if (linkColIndex == 0) return;\n\n    var editedRange = e.range;\n    if (editedRange.getColumn() != linkColIndex) return; //    \n\n    var newValue = editedRange.getValue();\n    if (!newValue || newValue.toString().trim() == "") return; //     \n\n    var row = editedRange.getRow();\n    //      inline  (callback_data  action:row)\n    var botToken = PropertiesService.getScriptProperties().getProperty("BOT_TOKEN");\n    var adminChatId = PropertiesService.getScriptProperties().getProperty("ADMIN_CHAT_ID");\n\n    var text = "     " + row + ": " + newValue + "\\n ?";\n    var payload = {\n      chat_id: adminChatId,\n      text: text,\n      reply_markup: JSON.stringify({\n        inline_keyboard: [\n          [{ text: "", callback_data: "approve:" + row }],\n          [{ text: "", callback_data: "reject:" + row }]\n        ]\n      })\n    };\n\n    var url = "https://api.telegram.org/bot" + botToken + "/sendMessage";\n    var options = {\n      method: "post",\n      payload: payload,\n      muteHttpExceptions: true\n    };\n    UrlFetchApp.fetch(url, options);\n  } catch (err) {\n    Logger.log("Error in onEditNotify: " + err);\n  }\n}\n```\n\n:\n-     onEdit (simple trigger)   UrlFetchApp  simple triggers      UrlFetchApp;  installable trigger:\n  -  Apps Script  Triggers  Add Trigger  Function to run: onEditNotify, Event: From spreadsheet, On edit   "On edit" (installable).     UrlFetchApp.\n-  Script Properties (File  Project properties  Script properties)  BOT_TOKEN  ADMIN_CHAT_ID. ADMIN_CHAT_ID     id  ( ,     update.effective_user.id).\n\n 5    (callback_query)\n-  Apps Script     inline ,   Telegram  callback_query    (  Python).   (. callback_query_handler)   callback_data,  row    Google Sheets   (/   chat_id),     .\n\n    chat_id:\n- ,    ""      id  (chat_id)   Apps Script/ .         "" (   ).\n-            chat_id       .\n\n 6   \n-         (VPS, cloud VM, Heroku, Railway  ..).   polling    .    webhook ( HTTPS   ).\n- ,  service_account.json      .\n\n 7    \n1.      .\n2.  Telegram    /start     . ,    ""   [id, , ].\n3.   ""    " "     .\n4. ,         /.\n5.         (     )      .\n6.       (     callback handler).\n\n   \n-  BOT_TOKEN  service account JSON    (env vars, vault).  Apps Script  Script Properties.\n-      service account.\n-   ""   "status" (, Pending / Sent / Rejected)     ;      .\n-        Slack/Email.\n-    ( ).\n-  ,      Google Sheets   :           .        Sheets      .\n\n      Google Sheets    \n- : /      ;          ( , ). ..      onEdit  .\n-  1 ():                 .     Apps Script  (UrlFetchApp  Telegram Bot API).\n-  2 (, ):     Telegra